#!/bin/bash

# prompt "Question" "Default value"
function prompt() {
  osascript <<EOT
    tell app "System Events"
      text returned of (display dialog "$1" default answer "$2" buttons {"OK"} default button 1 with title "$(basename $0)")
    end tell
EOT
}

query="$(prompt 'Enter Search Box Text:' '')"

adtitle="$(prompt 'Enter Ad Title:' '')"

url="$(prompt 'Enter Ad URL:' '')"

text="$(prompt 'Enter Ad Text:' '')"

echo $query
echo $adtitle
echo $url
echo $text



name=$( echo "$query"|cut -d' ' -f1)

cat << _EOF_ > ~/Desktop/$name-ad.html

